async function updateShowingTimeLeft(t){try{var a=await fetch("/api/data/update-showing-time-left",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({showingTimeLeft:t})});if(!a.ok)throw await a.text(),new Error("Network response was not ok");await a.json()}catch(t){}}export{updateShowingTimeLeft};